import axios from "axios";
import React, { useEffect, useState } from "react";
import Dog from "../models/dog";
import DogCard from "../components/DogCard"
import { FormControl, Grid, InputLabel, MenuItem, Select, TextField } from "@mui/material";

export default function IndexPage() {

    const [dogs, setDogs] = useState<Dog[]>([])

    useEffect(() => {
        fetchDogSearchResults(1);
    }, []);

    const fetchDogSearchResults = (pageNumber: Number) => {
        axios.get(`https://api.thedogapi.com/v1/images/search?limit=25&page=${pageNumber}&order=Desc`)
            .then(response => {
                var currentdogs = [...dogs];
                debugger;
                currentdogs = currentdogs.concat(response.data);
                setDogs(currentdogs);
            })
            .catch(error => {
                //this.setState({ errorMessage: error.message });
                console.error('There was an error!', error);
            });
    }
    const searchType: string = "10";
    const handleChange = () => {

    }
    return (
        <div>
            <div>
                <FormControl>
                    <InputLabel id="demo-simple-select-label">Search By</InputLabel>
                    <Select
                        labelId="demo-simple-select-label"
                        id="demo-simple-select"
                        value={searchType}
                        label="Search By"
                        onChange={handleChange}
                    >
                        <MenuItem value={10}>Ten</MenuItem>
                        <MenuItem value={20}>Twenty</MenuItem>
                        <MenuItem value={30}>Thirty</MenuItem>
                    </Select>
                </FormControl>
            </div>
            {
                dogs && dogs.length > 0 ? dogs.map((dog, index) => {
                    return (<DogCard url={dog.url} id={dog.id}
                        title={dog.breeds[0]?.name}
                        description={dog.breeds[0]?.bred_for} />)
                }) : null
            }
        </div >
    );
}
